VALUES ('3596710020140', 'Auchan Mini Bâtonnets x24 - 240g', 'Mini-bâtonnets de surimi : Surimi 38% (chair de poisson 94%, sucre), eau, blanc d\'œuf en poudre réhydraté 7,6%, amidon de blé (contient gluten) 4.7%, fécule de pomme de terre 4,7%, huile de colza 3.8%, sel 1 ,7%, sucre 1 %, arôme (contient crustacé) 0,9%, colorant : extrait de paprika Merlan bleu pêché en Atlantique nord-Est, pourcentage exprimé sur le surimi. Traces éventuelles de mollusques. Sauce mayonnaise : huile de colza, eau, jaune dlœuf salé, moutarde de Dijon (eau, graines de moutarde, vinaigre, sel, antioxydant : disulfite de potassium, acidifiant : acide citrique), vinaigre d\'alcool, sucre, sel, amidon modifié de pomme de terre ; épaississants : gomme guar, gomme xanthane. Conseils de conservation : Avant ouverture : à conserver entre 0 et +40C. Après ouverture : après ouverture du sachet fraîcheur, consommer rapidement. Valeurs nutritionnelles moyennes pour 100g (87,5g de surimi et 12,5g de mayonnaise). Energie : 726 kJ soit 174 kcal, matières grasses : 11 dont a.g. saturés : 1,0g, glucides : 10,9g dont sucres : 2,9g, protéines : 6,3g, sel : 1,63g. Valeurs nutritionnelles moyennes pour 1 portion de 80g (7 mini-bâtonnets et 10g de mayonnaise). Energie : 581 kJ soit 139 kcal, matières grasses : 9,4g dont a.g. saturés : 0,8g, glucides : 8,7g dont sucres : 2,3g, protéines : 5,0g, sel : 1,3g. Cet emballage contient l\'équivalent de 3 portions de 80g.', '', '11.8', '1', '10.09', '2.9', '', '6.3', '1.63', '0.641732283464567', '', '0');

