VALUES ('3596710261437', '2 Bouchées à la Reine', 'Garniture 61%: lait, champignons 15% (champignons, eau, sel, acidifiant: acide citrique, antioxydant : acide ascorbique), quenelle de volaille et de porc 12% [viande gros grain de volaille, gorge de porc, eau, _œuf_, farine de blé (contient _gluten_), blanc d\'_œuf_, margarine (graisses et huile végétales (palme, colza), eau, sel, emulsifiant: mono- et diglycérides d\'acides gras, correcteur d\'acidité: acide citrique), sel, _gluten_ de _blé_ (_gluten_ vital de blé, protéines de blé), amidon de blé (contient _gluten_), bouillon de volaille, dextrose, muscade], farine de blé (contient _gluten_), blanquette de dinde saumurée cuite 6% (blanquette de dinde, eau, sel, lactose (contient _lait_), dextrose, bouillon de volaille gélifiant: carraghénanes, sirop de glucose), margarine, (graisses et huiles végétales (palme, colza), eau, sel, émulsifiant: mono- et diglycérides d\'acides gras, correcteur d\'acidité: acide citrique), porto blanc aromatisé (porto blanc, sel, poivre), crème fraîche légère (contient _lait_), arôme naturel, lactose (contient _lait_) et protéines de _lait_, conservateur : sorbate de potassium, sel, poivre, muscade. Pâte feuilletée 39%: farine de blé (contient _gluten_), margarine (graisses et huiles végétales (palme, colza), eau, sel, émulsifiant: mono- et diglycérides d\'acides gras, correcteur d\'acidité: acide citrique, colorant: caroténoïdes), eau, dorure (jaune d\'_œuf_, eau, sucre caramélisé), sel, levure désactivée, son de blé (contient _gluten_).', 'https://static.openfoodfacts.org/images/products/359/671/026/1437/front.6.400.jpg', '18.4', '9.2', '23.2', '4.4', '', '6.1', '1.3', '0.511811023622047', '', '0');

